const renderResumeTemplate = (templateID, candidateResumeDetail) => {
    switch (templateID) {
        case 1: return (template1(candidateResumeDetail)); break;
        case 2: return (template2(candidateResumeDetail)); break;
        case 3: return (template3(candidateResumeDetail)); break;
        case 4: return (template4(candidateResumeDetail)); break;
        case 5: return (template5(candidateResumeDetail)); break;
        case 6: return (template6(candidateResumeDetail)); break;
        default: return (template1(candidateResumeDetail));
    }
}

